@CraigHadleyGA Thanks for reaching out. While Diet Barq's Root Beer has been updated to Barq's Zero Sugar Root Beer, the formula has not changed. Our local,
independent bottlers offer a variety of packaging and cans in a particular
carton may not feature the same design as that on the carton.

